import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Home from "./routes/Home";

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/">
          {" "}
          //유저가 홈화면으로 갈 때 사용할 route
          <Home /> //유저가 홈화면에 있으면 Home을 보여줌
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
